import "./Home.scss";

function Home() {
  return (
    <div className="home">
      <div className="home__image">
        <h1 className="home__about-us">About Us</h1>
      </div>

      <p className="home__paragraph">
        Straycats have very short lives around 3 ~ 5 years. Being homeless,
        foodless, not knowing where the next meal comes from, not always in good
        health, they also have to bear the crises emerging from around. They
        need to find a shelter with loving owners.{" "}
      </p>
    </div>
  );
}
export default Home;
